import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on profile link using text content
    await page.waitForSelector('text=Your Profile', { timeout: 5000 });
    await page.click('text=Your Profile');

    // Wait for profile page to load and verify navigation
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.waitForSelector('text=Jun Kim', { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information
    const profileData = {
      name: await page.textContent('.profile-info h2'),
      username: await page.textContent('.username'),
      bio: await page.textContent('.bio')
    };

    return {
      success: true,
      action: "Navigated to Jun's Profile page successfully",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
